css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.myproana.com") {

html, body {

  color: #505050 !important;

}



html > body {

  background-image: url("http://www.themesltd.com/backgrounds/floral/water_color_flowers.gif") !important;

}



.cke_show_borders {

  background: #fff !important;

  color: #000 !important;

}



a {

  color: #E677E6 !important;

}



#main_search {

  color: #f0c1f0

}



.desc, .desc.blend_links a, p.posted_info {

  color: #505050 !important;

}



#content {

  background: url("http://p1.pichost.me/i/39/1624231.jpg") !important;

}



#branding {

  background: none !important;

  padding: 20px 0 20px 0 !important;
  
  

}



.maintitle, #primary_nav, .popupInner h3, .ipsSideBlock h3 {

  background: url("http://www.themesltd.com/backgrounds/floral/water_color_flowers.gif") !important;

  border: 1px solid #493324 !important;

  height: 26px !important;

  color: #fffff !important;

  box-shadow: none !important;

}



.maintitle, .ipsSideBlock h3 {

  height: 13px !important;

  padding: 10px !important;

  font-weight: bold !important;

}



.popupInner {

  background: #363636 !important;

  box-shadow: none !important;

}



#primary_nav {

  background: url("http://theartmad.com/wp-content/uploads/Dark-Grey-Wood-Background-6.jpg") !important;

}



#primary_nav a {

  background: url("http://theartmad.com/wp-content/uploads/Dark-Grey-Wood-Background-6.jpg") !important;

  background: none !important;

  color: #f0c1f0 !important;

  text-shadow: none !important;

  font-weight: bold;

}



#primary_nav a:hover {

  background: url("http://theartmad.com/wp-content/uploads/Dark-Grey-Wood-Background-6.jpg") !important;

}



.maintitle a {

  color: #000000 !important;

  font-weight: bold;

}



.ipsBox {

  background: #f0c1f0 !important;

}



.ipsBox_container {

  background: #363636 !important;

}



.unread, .ipb_table tr {

  background: #f2dbf1 !important;

}



.col_c_stats, .col_c_post {

  background: #252525 !important;

}



.ipsBox_container {

  border: 1px solid #464646 !important;

}



table.ipb_table td {

  border-bottom: 1px solid #464646 !important;

}



.post_block {

  background: none repeat scroll 0 0 #f2dbf1 !important;

  border-color: #E7D9E8 !important;

}



.row2, .post_block.row2, .col_f_icon {

  background: none repeat scroll 0 0 #262626 !important;

}



.post_body .post {

  color: #000000 !important;

}



p.citation {

  background: #DCBAE8 !important;

  border: 1px solid #595959 !important;

  border-bottom: none !important;

}



.ipsFilterbar a:hover {

  color: #FF6ED1 !important;

}



div.blockquote {

  background: #464646 !important;

  border: 1px solid #595959 !important;

}



#search_wrap {

  background: none repeat scroll 0 0 #1D1D1D !important;

  border: 1px solid #464646;

}



.ipsHeaderMenu {

  background: #585858 !important;

  border-radius: 0 0 6px 6px;

}



#user_link.menu_active, #notify_link.menu_active, #inbox_link.menu_active {

  background-color: #585858 !important;

}



.row1, .post_block.row1 {

  background-color: #585858 !important;

}



.ipsType_sectiontitle {

  border-bottom: none !important;

  color: #FFFFFF !important;

}



.ipsType_pagetitle, .ipsType_subtitle {

  color: #FFFFFF !important;

}



.desc.lighter, .desc.lighter.blend_links a {

  color: #5B5B5B !important;

}



.input_submit, .topic_buttons li.important a, .topic_buttons li.important span, .ipsButton .important, .topic_buttons li a, .topic_buttons li span, .ipsButton {

  background: none repeat scroll 0 0 #f0c1f0 !important;

  border-color: #12073B !important;

  border-style: none !important;

  box-shadow: none !important;

  text-shadow: none !important;

  font-weight: bold !important;

  color: #FFFFFF !important;

}



.ipsButton_secondary, .pagination .back a, .pagination .forward a, #search_options {

  background: none repeat scroll 0 0 #f0c1f0 !important;

  border-color: #000 !important;

  color: #505050 !important;

  box-shadow: none !important;

}


.general_box {

  background: URL(http://i63.tinypic.com/ddeyp5.jpg) repeat scroll 0 0 #EBDFEA !important;

}



.ipbmenu_content, .ipb_autocomplete {

  background-color: #585858 !important;

  border: 1px solid #363636 !important;

  box-shadow: none !important;

  color: #B2B2B2;

}





.general_box h3 {

  background: none repeat scroll 0 0 #494949 !important;

  color: #f0c1f0 !important;

  font-weight: bold !important;

}



.ipsVerticalTabbed_tabs li {

  background: #585858 !important;

  border-color: #242424 !important;

  color: #88629F;

}



.ipsVerticalTabbed_tabs > ul {

  border: none !important;

}



.status_update {

  background: none repeat scroll 0 0 #f2dbf1 !important;

  color: #FFFFFF;

}



#user_link_menucontent a {

  color: #FF6ED1 !important;

  text-shadow: none !important;

}



body#ipboard_body fieldset.submit, body#ipboard_body p.submit {

  background: #464646 !important;

}



.input_text, .ipsTagBox_wrapper {

  border: 1px solid #EAEAEA !important;

  color: #363636;

}



#main_search_form .search_app.active {

  background: #C67EF2 !important;

  border: 2px solid #C67EF2 !important;

  color: #C67EF2 !important;

}



.ipsSideBlock {

  background: #363636 !important;

}





img[src="http://i65.tinypic.com/33o5nbp.gif"] {

  width: 0 !important;

  height: 32px !important;

  padding-right: 32px;

  background: url("http://i65.tinypic.com/33o5nbp.gif") !important; 

}



}
